import React from 'react'
import s from './Users.module.css'

const Users = (props) => {
    const pageCountNum = Math.ceil(props.usersCount / props.trueUsersCount)
    let pageCount = []
    for (let i = 1; i <= pageCountNum; i++) {
        pageCount.push(i)
    }
    return (
        <div className={s.main}>
            {pageCount.map(item => <span className={props.active} onClick={() => props.changePage(item)}>{` ${item}`}</span>)}
            {props.users.map(item => <div>{item.name}</div>)}
        </div>
    )
}

export default Users
